import React, { Component } from 'react';



class Live extends Component {
	state = {};

	// Life Cycle Method
	componentDidMount() {
		// About the Genius API https://docs.genius.com/#/getting-started-h1
		// Work through the steps inside of the render function
		// If you get finished, try picking another API (maybe your final project choice)
		// And use FETCH to pull data from it.
		fetch(
			'https://api.kijanigrows.com/v2/device/get/RedVic'
			//'https://hn.algolia.com/api/v1/search?query=sony'
		)
			.then((response) => {
				//console.log(response); //this won't give us the data we need since it's only a promise
				return response.json();
			})
			.then((data) => {
				data = data;
				this.setState({
					data // this will set the key to the same value as the variable - data array
				});
				console.log(data);
			});
	}

	// Life Cycle Method
	render() {
		let newData = [];
	//	console.log("this.state.data" + this.state.data);

		for (let item in this.state.data) {

			// 1. Can you get the list of songs associated with this artist to show up?
			// 2. Can you get an image to appear?
			// 3. Can you link out the to the original webpage for each song?
			let { flow_rate_sensor, humidity, humidity_dew_point, nutrientTemp,ph,temperature_0 } = this.state.data[item].pins;
			let { time, uptime, version, wlan0 } = this.state.data[item];


			// let fullTitle = this.state.data[item].result.title;
			// let song_art_image_url = this.state.data[item].result.song_art_image_url;
			// let url = this.state.data[item].result.url;
			//console.log(fullTitle);
			newData.push(
				<ul>
					<table class="table table-borderless table-sm">
							  <thead>
							    <tr>
							      <th scope="col"></th>
							      <th scope="col"></th>
							      <th scope="col"></th>
							      <th scope="col"></th>
							    </tr>
							  </thead>
							  <tbody>
							    <tr>
							      <th scope="row"><img src='./flowrate.jpg' className="img-thumbnail" style={{width: '100px'}} /></th>
							      <td>Flow rate Sensor: </td>
							      <td>{flow_rate_sensor}</td>

							    </tr>
							    <tr>
							      <th scope="row"><img src='./humidity.png' className="img-thumbnail" style={{width: '100px'}} /> </th>
							      <td>Humidity:</td>
							      <td>{humidity} </td>

							    </tr>
							    <tr>
							      <th scope="row">3</th>
							      <td colspan="2">Larry the Bird</td>
							      <td>@twitter</td>
							    </tr>
							  </tbody>
							</table>

						<li className="list-group-item text-dark text-left">
						<p><img src='./flowrate.jpg' className="img-thumbnail" style={{width: '100px'}} /> Flow rate Sensor: {flow_rate_sensor} </p>
						<p> <img src='./humidity.png' className="img-thumbnail" style={{width: '100px'}} /> Humidity: {humidity} </p>
						<p> <img src='./humiditydew.png' className="img-thumbnail" style={{width: '100px'}} /> Humidity Dew Point:  {humidity_dew_point} </p>
						<p> <img src='./nutrienttemp.png' className="img-thumbnail" style={{width: '100px'}} /> Nutrient Temp: {nutrientTemp} </p>
						<p> <img src='./ph.png' className="img-thumbnail" style={{width: '100px'}} /> PH Level: {ph} </p>
					  <p> <img src='./temp.jpg' className="img-thumbnail" style={{width: '100px'}} /> Temperature:	{temperature_0} </p>
						<p> <img src='./time.png' className="img-thumbnail" style={{width: '100px'}} /> Time: {time} </p>
						<p> <img src='./uptime.png' className="img-thumbnail" style={{width: '100px'}} /> Up time: {uptime} </p>

						</li>
			</ul>
		);
		}

		return (
			<div className="App">
				<header className="App-header">
					<ul className="list-group m-4">{newData}</ul>


				</header>
			</div>
		);
	}
}

export default Live;
